import React from 'react';

// --- Local SVG Icons ---
// I've moved the icons into this file to resolve the import error.

const GraduationCapIcon = ({ className = "icon" }) => (
  <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}>
    <path d="M21.42 10.922a1 1 0 0 0-.019-1.838L12.83 5.18a2 2 0 0 0-1.66 0L2.6 9.084a1 1 0 0 0 0 1.838l8.57 3.908a2 2 0 0 0 1.66 0l8.59-3.908z"></path>
    <path d="M6 12v4c0 4.5 6 4 6 0v-4"></path>
    <path d="m22 10-10-5-10 5"></path>
  </svg>
);

const MenuIcon = ({ className = "icon" }) => (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}>
        <line x1="3" y1="12" x2="21" y2="12"></line>
        <line x1="3" y1="6" x2="21" y2="6"></line>
        <line x1="3" y1="18" x2="21" y2="18"></line>
    </svg>
);


// --- Header Component ---

const NavLink = ({ href, children }) => (
    <a href={href} className="nav-link">{children}</a>
);

export default function Header() {
    const [isMenuOpen, setIsMenuOpen] = React.useState(false);
    
    return (
        <header className="header">
            <div className="container header-content">
                <div className="header-brand">
                     <GraduationCapIcon className="icon-large"/>
                     <span>Collegexplorer</span>
                </div>
                <nav className="header-nav">
                    <NavLink href="/home">Home</NavLink>
                    <NavLink href="/colleges">Colleges</NavLink>
                    <NavLink href="/courses">Courses</NavLink>
                    <NavLink href="/about">About Us</NavLink>
                    <NavLink href="/blog">Blogs</NavLink>
                    <NavLink href="/contact">Contact Us</NavLink>
                    <NavLink href="/enrollnow">Enroll Now</NavLink>
                    <NavLink href="/admin">Admin</NavLink>
                </nav>
                {/* <div className="header-actions">
                     <button className="btn-primary">
                        Login / Register
                    </button>
                </div> */}
                <button onClick={() => setIsMenuOpen(!isMenuOpen)} className="mobile-menu-button">
                    <MenuIcon />
                </button>
            </div>
             {isMenuOpen && (
                <div className="mobile-nav-container">
                    <nav className="mobile-nav">
                        <NavLink href="/home">Home</NavLink>
                        <NavLink href="/colleges">Colleges</NavLink>
                        <NavLink href="/courses">Courses</NavLink>
                        <NavLink href="/about">About </NavLink>
                        <NavLink href="/blog">Blogs</NavLink>
                        <NavLink href="/contact">Contact Us</NavLink>
                         <NavLink href="/enrollnow">Enroll Now</NavLink>
                        {/* <button className="btn-primary">
                           Login / Register
                       </button> */}
                    </nav>
                </div>
            )}
        </header>
    );
};
